import { Card } from "../../Card.styled";
const SectionSix = () => {
  return (
    <>
      <Card bd={"1px solid red"} height={"25rem"}>
        <Card
          ps={"relative"}
          pstp={"30%"}
          pslt={"30%"}
          bd={"1px solid blue"}
          width={"40%"}
          height={"40%"}
        ></Card>
      </Card>
    </>
  );
};

export default SectionSix;
